import React from 'react'
import SingleUser from './SingleUser'

const UsersList = (props) => {
    return (
        <>
            <table>
                <tbody>
                <tr>
                    <th>ID</th>
                    <th>First Name</th>
                    <th>Last Name</th>
                    <th>Age</th>
                    <th>Phone</th>
                </tr>
                {props.users.map(user =>
                    <SingleUser
                        key={user.id}
                        id={user.id}
                        first_name={user.first_name}
                        last_name={user.last_name}
                        age={user.age}
                        phone={user.phone}
                    />

                )}
                </tbody>
            </table>
            <button>Add</button>
        </>
    )
}

export default UsersList
